  background-color: rgb(51, 47, 81);\\\\n  background-color: var(--gray-800);\\\\n}\\\\n\\\\nhtml.theme-dark .tab-nav,\\\\nhtml.theme-dark .dropdown {\\\\n  background-color: rgb(209, 204, 224);\\\\n  background-color: var(--gray-400);\\\\n}\\\\n\\\\n.alert {\\\\n  padding-left: 1rem;\\\\n  padding-right: 1rem;\\\\n  padding-top: 0.5rem;\\\\n  padding-bottom: 0.5rem;\\\\n  color: rgb(75, 71, 109);\\\\n  color: var(--gray-700);\\\\n  border-width: 0;\\\\n  border-left-width: 2px;\\\\n  border-color: rgba(0, 0, 150, 0.025);\\\\n  border-color: var(--tint-100);\\\\n}\\\\n\\\\n.alert-warning {\\\\n  background-color: rgb(255, 253, 235);\\\\n  background-color: var(--yellow-100);\\\\n  border-color: rgb(255, 234, 79);\\\\n  border-color: var(--yellow-400);\\\\n}\\\\n\\\\n.alert-empty {\\\\n  color: rgba(30, 20, 90, 0.35);\\\\n  color: var(--tint-500);\\\\n  padding-top: 2rem;\\\\n  padding-bottom: 2rem;\\\\n  text-align: center;\\\\n}\\\\n\\\\n.button {\\\\n  display: inline-flex;\\\\n  align-items: center;\\\\n  justify-items: center;\\\\n  align-content: center;\\\\n  justify-content: center;\\\\n  padding-left: 1rem;\\\\n  padding-right: 1rem;\\\\n  min-height: 2.5rem;\\\\n  border-width: 0;\\\\n  background-color: rgb(121, 0, 245);\\\\n  background-color: var(--purple-500);\\\\n  overflow: hidden;\\\\n  border-radius: 0.125rem;\\\\n  color: rgb(255, 255, 255);\\\\n  color: var(--white);\\\\n  line-height: 1;\\\\n  text-decoration: none;\\\\n}\\\\n\\\\n.button:after {\\\\n  content: \\\\\'\\\\\';\\\\n  display: block;\\\\n  position: absolute;\\\\n  left: 100%;\\\\n  bottom: 0;\\\\n  width: 200%;\\\\n  height: 100vh;\\\\n  background-color: rgba(30, 20, 90, 0.35);\\\\n  background-color: var(--tint-500);\\\\n  transform: translateX(-1rem) skewX(-65deg);\\\\n  transform-origin: 0% 100%;\\\\n  transition: transform 0.75s ease-out;\\\\n}\\\\n\\\\n.button:hover:after {\\\\n  transform: translateX(-1.5rem) skewX(-65deg);\\\\n  transition-duration: 0.3s;\\\\n}\\\\n\\\\n.button:not(:disabled):active:after {\\\\n  transition-delay: 0.2s;\\\\n  transition-duration: 0.3s;\\\\n  transform: translateX(-100%) skewX(-65deg);\\\\n}\\\\n\\\\n.button-secondary {\\\\n  display: inline-flex;\\\\n  align-items: center;\\\\n  justify-items: center;\\\\n  align-content: center;\\\\n  justify-content: center;\\\\n  padding-left: 1rem;\\\\n  padding-right: 1rem;\\\\n  min-height: 2.5rem;\\\\n  border-width: 0;\\\\n  background-color: rgb(121, 0, 245);\\\\n  background-color: var(--purple-500);\\\\n  overflow: hidden;\\\\n  border-radius: 0.125rem;\\\\n  color: rgb(255, 255, 255);\\\\n  color: var(--white);\\\\n  line-height: 1;\\\\n  text-decoration: none;\\\\n  background-color: rgba(0, 0, 100, 0.07);\\\\n  background-color: var(--tint-200);\\\\n  color: rgba(15, 10, 60, 0.75);\\\\n  color: var(--tint-700);\\\\n}\\\\n\\\\n.button-secondary:hover {\\\\n  background-color: rgba(25, 0, 100, 0.1);\\\\n  background-color: var(--tint-300);\\\\n}\\\\n\\\\n.button-secondary:not(:disabled):active {\\\\n  background-color: rgba(30, 20, 90, 0.35);\\\\n  background-color: var(--tint-500);\\\\n  opacity: 0.5;\\\\n}\\\\n\\\\n.button:focus,\\\\n.button-secondary:focus {\\\\n  outline: 0;\\\\n}\\\\n\\\\n.button:disabled,\\\\n.button-secondary:disabled {\\\\n  cursor: not-allowed;\\\\n  opacity: 0.25;\\\\n}\\\\n\\\\n.button-sm {\\\\n  font-size: 0.875rem;\\\\n}\\\\n\\\\n.button.button-sm,\\\\n.button-secondary.button-sm {\\\\n  padding-left: 0.5rem;\\\\n  padding-right: 0.5rem;\\\\n  min-height: 1.5rem;\\\\n  border-radius: 0.125rem;\\\\n}\\\\n\\\\n.button-lg {\\\\n  font-size: 1.125rem;\\\\n}\\\\n\\\\n.button.button-lg,\\\\n.button-secondary.button-lg {\\\\n  padding-left: 1.5rem;\\\\n  padding-right: 1.5rem;\\\\n  min-height: 3rem;\\\\n}\\\\n\\\\n.button-lg.button:after {\\\\n  transform: translateX(-2rem) skewX(-65deg);\\\\n}\\\\n\\\\n.button-lg.button:hover:after {\\\\n  transform: translateX(-3rem) skewX(-65deg);\\\\n}\\\\n\\\\n.card {\\\\n  position: relative;\\\\n  display: grid;\\\\n  align-items: stretch;\\\\n  border-width: 1px;\\\\n  border-color: rgba(25, 0, 100, 0.1);\\\\n  border-color: var(--tint-300);\\\\n  background-color: rgb(255, 255, 255);\\\\n  background-color: var(--white);\\\\n  box-shadow: var(--shadow-sm);\\\\n  border-radius: 0.125rem;\\\\n}\\\\n\\\\n.card-details {\\\\n  overflow: hidden;\\\\n}\\\\n\\\\n.card-details-overflow {\\\\n  display: grid;\\\\n  grid-gap: 1rem;\\\\n  padding: 1.5rem;\\\\n  overflow-x: auto;\\\\n}\\\\n\\\\n@media (min-width: 768px) {\\\\n  .card {\\\\n    grid-template-columns: 16rem 1fr;\\\\n  }\\\\n\\\\n  .card-has-header {\\\\n    grid-template-rows: auto 1fr;\\\\n  }\\\\n\\\\n  .card.card-no-props {\\\\n    display: block;\\\\n  }\\\\n\\\\n  .card-header {\\\\n    grid-column-end: span 2;\\\\n  }\\\\n\\\\n  .card-details-overflow {\\\\n    padding: 2rem;\\\\n  }\\\\n}\\\\n\\\\n.checkbox-label {\\\\n  display: grid;\\\\n  justify-content: flex-start;\\\\n  grid-template-columns: auto;\\\\n  grid-auto-flow: column;\\\\n  grid-gap: 0.5rem;\\\\n  min-height: 0;\\\\n  cursor: pointer;\\\\n  color: rgb(51, 47, 81);\\\\n  color: var(--gray-800);\\\\n}\\\\n\\\\n.checkbox {\\\\n  width: 1.5em;\\\\n  height: 1.5em;\\\\n  border-style: none;\\\\n  -webkit-appearance: none;\\\\n     -moz-appearance: none;\\\\n          appearance: none;\\\\n}\\\\n\\\\n.checkbox:before {\\\\n  position: absolute;\\\\n  width: 1.5em;\\\\n  height: 1.5em;\\\\n  border-width: 1px;\\\\n  border-color: rgba(0, 0, 100, 0.07);\\\\n  border-color: var(--tint-200);\\\\n  background-color: rgb(252, 252, 253);\\\\n  background-color: var(--gray-50);\\\\n  box-shadow: var(--shadow-default);\\\\n  border-radius: 0.125rem;\\\\n  overflow: hidden;\\\\n  content: \\\\\'\\\\\';\\\\n}\\\\n\\\\n.checkbox:after {\\\\n  position: absolute;\\\\n  top: 50%;\\\\n  left: 50%;\\\\n  color: rgb(121, 0, 245);\\\\n  color: var(--purple-500);\\\\n  font-size: 1.2em;\\\\n  font-weight: 900;\\\\n  line-height: 1;\\\\n  content: \\\\